package com.study;

public class NestedIfElseBlock {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=100;
		int b=200;
		
		if(a<b)
		{
			if(a==b)
			{
				System.err.println("1");
			}else {
				System.err.println("2");
				
			}
		}else {
			System.out.println("3");
			
		}
		
	}

}
